#AJ Sung Q1 ADS Summative check generator

def hash_double(input):

    hash_table = ["-"] * 19

    for k in input:

        position = (6 * k + 3) % 19
        collisions = 0

        while hash_table[position] != "-":

            position = (position + (11 - k % 11)) % 19
            collisions += 1

            if collisions == 19:
                return hash_table

        hash_table[position] = k

    return hash_table


def hash_quadratic(input):

    hash_table = ["-"]*19

    for k in input:

        position = (6 * k + 3) % 19
        collisions = 1

        while hash_table[position] != "-":

            position = (position - (collisions-1)**2 + collisions**2)%19

            collisions += 1

            if collisions == 100:
                break

        if collisions != 100:
            hash_table[position] = k

    return hash_table


